<p><strong>User Schema</strong></p>

<pre><code>const UserSchema = new mongoose.Schema({
    name: String,
    email: String,
    post: [ mongoose.Types.ObjectId, ref: 'posts' ]
});
</code></pre>

<p><strong>Post Schema</strong></p>

<pre><code>const UserSchema = new mongoose.Schema({
    title: String,
    content: String,
    postedOn: Date
});
</code></pre>

<p>I want to fetch post with respect to a user's id. But I don't want the whole Post document in return. I only want the attribute "Title" and "Date"<br>
I tried the command:-</p>

<pre><code>const posts = await User.findById(user_id).populate('post');
</code></pre>

<p>But it returns the entire collection. Can anyone tell me how can I fetch only "Title" and "Date" attribute of the post(sub-document) from User Model?</p>

