<p>my models are as follows and I am trying to join all the component records under the associated Airframe. the airframe field on the Component holds the related Airframes' id.</p>

<pre><code>const airframeSchema = mongoose.Schema({
  name: { type: String, required: true },
  sNumber: { type: String, required: true },
  aStatus: { type: String, required: true },
  components: [ { 
    type: mongoose.Schema.Types.ObjectId, 
    ref: 'Component' } ]
});
module.exports = mongoose.model('Airframe', airframeSchema);

const componentSchema = mongoose.Schema({
  name: { type: String, required: true },
  serial: { type: String, required: true }, 
  type: { type: String, required: true },
  airFrame: { 
    type: mongoose.Schema.Types.ObjectId, 
    required: true,
    ref: 'Airframe'},
});

module.exports = mongoose.model('Component', componentSchema);
</code></pre>

<p>the AirFramesService is as follow. I would like to join the component data under a array called "component".  </p>

