        this.airframes = airframes;
        }, 0);
    });
  }
</code></pre>

<p>the desired outcome would be the following (at the moment I only get the airframe data):</p>

<pre><code>{
    _id: "123"
    name: "Airframe01"
    sNumber: "757"
    aStatus: "Active"
    id: "5e8052ad1fa18f1c73524664"
    components: [
      {
