MongoDB slice - remove last n elements from nested arrays<p>Supposing I have the following array:</p>

<pre><code>{
   data: [1, 0, 4, 0, 0, 4, 1, 3, 0, 1, 0, 2, 2, 0, 1, 1, 0, 2, 0, 4, 1, 1, 0, 1, 1, 0]
}
</code></pre>

<p>if I want to select all the elements, except the last 3, I can use the solution proposed <a href="https://stackoverflow.com/a/61047651/12832931">here</a></p>

<pre><code>db.collection.aggregate([
  {
    $project: {
      "_id": 0,
      "data": {
        "$slice": [ 
          "$data",
          0,
          {
            $subtract: [ { $size: "$data" }, 3 ]
          }
        ]
      }
    }
  }
])
</code></pre>

<p>I can get the desired output:</p>

<pre><code>[1, 0, 4, 0, 0, 4, 1, 3, 0, 1, 0, 2, 2, 0, 1, 1, 0, 2, 0, 4, 1, 1, 0]
</code></pre>

<p>How can I do the same thing for concatenated/nested arrays like:</p>

<pre><code> {
       data: [[1, 0, 4, 0, 0, 4, 1], [1, 0, 4, 0, 1, 5, 3]]
 }
</code></pre>

<p>In order to select all the elements, except the last 3 (of each array)?</p>

<p>Expected output:</p>

<pre><code>        {
           data: [[1, 0, 4, 0], [1, 0, 4, 0]]
        }
</code></pre>

